(3, 'দেখবার জন্য আমাদের চোখের যেমন আলোর প্রয়োজন, ঠিক তেমনী কোনো প্রত্যয় অর্জন করবার জন্য আমাদের ভাবনার প্রয়োজনটি', '- নিকোলাস খালব্রাঁশ', NULL),
(4, 'নতুন জানার যেমন যন্ত্রনা আছে, তেমনি আনন্দও আছেি', ' - ক্রিস্টোফার মর্লি', NULL),
(5, 'যে কখনও ভুল করেনা। সে নতুন কিছু করার চেষ্টা করে না।', ' - অ্যালবার্ট আইনস্টাইনলি', NULL),
(6, 'একজন ঘুমন্ত ব্যক্তি আরেকজন ঘুমন্ত ব্যক্তিকে জাগ্রত করতে পারে না।', ' - শেখ সাদিি', NULL),
(7, 'আমরা যতই অধ্যয়ন করি ততই আমাদের অজ্ঞানতাকে আবিষ্কার করি', '- শেলীি', NULL),
(8, 'অন্যদের ভুল থেকে শিক্ষাগ্রহণ করুন এবং সেইরকম মানুষ হয়ে যাওয়া থেকে নিজেকে বিরত রাখুন যাদের ভুলগুলো থেকে অন্যেরা শিক্ষাগ্রহণ করে।', '- শাইখ ইয়াসির ক্বাদী', NULL),
(9, 'শিক্ষার চূড়ান্ত ফল হচ্ছে সহনশীলতা', '- হেলেন কেলার', NULL),
(10, 'ধর্ম ও নৈতিকতার শিক্ষা সন্তানের জন্য সবচেয়ে বড় সম্পদ', '- আল কুরআন', NULL),
(11, 'বড় বড় নামকরা স্কুলে বাচ্চারা বিদ্যার চাইতে অহংকার টা বেশি শিক্ষা করে', '- আহমদ ছফা', NULL),
(12, 'মনুষ্যত্বের শিক্ষাটাই চরম শিক্ষা আর সমস্তই তার অধীন', '- রবীন্দ্রনাথ ঠাকুর', NULL),
(13, 'আমলা নয় মানুষ সৃষ্টি করুন', '- বঙ্গবন্ধু শেখ মুজিবুর রহমান', NULL),
(14, 'শিক্ষাই সর্বোত্তম বিনিয়োগ', '- সংগৃহীত', NULL),
(15, 'শিক্ষার শেকড় তেতো হলেও এর ফল সুমিষ্ঠ', '- সংগৃহীত', NULL),
(16, 'যে জাতি যত শিক্ষিত সে জাতি তত উন্নত', '- সংগৃহীত', NULL),
(17, 'তুমি আমাকে শিক্ষিত মা দাও, আমি তোমাকে শিক্ষিত জাতি দিবো\r\n', '- নেপোলিয়ন বোনাপার্ট', NULL);
