(19, 'যারা প্রোগ্রামার হতে চান তাদের অনেকেই চিন্তায় থাকেন কি ভাবে কি করবেন। তাদের জন্য এই পোষ্ট।', 'স্টেপ-১:\nপাঁচটা বেসিক জিনিস সম্পর্কে ক্লিয়ার ধারণা থাকতে হবে- variable, if-else, array, for loop এবং function। আরো বেশি শিখার জন্য একটা প্রোগ্রামিং ল্যাঙ্গুয়েজ ঠিক করতে হবে। পি এইচ পি, পাইথন, জাভা, C++, জাভাস্ক্রিপ্ট, C# বা অন্য যে কোন একটা।\nস্টেপ-২:\nপ্রোগ্রাম চলার সময় বিভিন্ন তথ্য বা ডাটা কিভাবে রাখতে হবে সেটা বুঝার জন্য কয়েকটা ডাটা স্ট্রাকচার (data structure) শিখতে হবে। তার মধ্যে হ্যাশ টেবিল (hash table) বা ডিকশনারি অবশ্যই শিখতে হবে। তারপরে Stack এবং Queue সম্পর্কে কিছু আইডিয়া নিতে হবে। এছাড়াও linked list, Tree নিয়ে ঘাটাঘাটি করতে পারেন।\nস্টেপ-৩:\nএকটা array এর মধ্যে নির্দিষ্ট কোন একটা উপাদান খুঁজে বের করা পদ্ধতিতে বলা হয় search। মিনিমাম linear search এবং binary search এর কোড নিজ হাতে লিখে প্রাকটিস করতে হবে।\nএকটা array এর উপাদানগুলিকে ছোট থেকে বড় বা বড় থেকে ছোট সাজানোর পদ্ধতিকে প্রোগ্রামিং এর ভাষায় sorting বলে। কমপক্ষে bubble sort নিজ হাতে প্রোগ্রামিং করতে পারতে হবে। অন্যসব sorting যেমন, merge sort, selection sort, insertion sort নিজে নিজে প্রোগ্রামিং করতে পারলে আপনি এগিয়ে যাবেন।\nস্টেপ-৪:\nকোন একটা সফটওয়্যার এপ্লিকেশনের ডাটা দীর্ঘ মেয়াদে সংরক্ষণ করার জন্য ডাটাবেস ব্যবহার করা হয়। ডাটাবেস গুলার মধ্যে Microsoft SQL এবং MySQL জনপ্রিয়। এই দুইটার যেকোনো একটাতে কিভাবে ডাটা রাখতে হয়, বের করে আনতে হয় সেটা জানতে হবে। আরো একটু বেশি জানতে চাইলে, কোন একটা স্কুলের বিভিন্ন ক্লাসের স্টুডেন্টদের নাম, সাবজেক্ট, পরীক্ষার নম্বর সহ যাবতীয় তথ্য সংরক্ষণের জন্য ডাটাবেসে কি কি টেবিল লাগবে সেটা শিখতে হবে।\nস্টেপ-৫:\nপ্রোগ্রামিং কনসেপ্ট সম্পর্কে ধারনা থাকতে হবে। তারমধ্যে সবচেয়ে গুরুত্বপূর্ণ হচ্ছে Object Oriented Programming যেটাকে সংক্ষেপে OOP বলা হয়। OOP তে প্রোগ্রাম এর বিভিন্ন জিনিসকে বাস্তব দুনিয়ার বস্তু বা অবজেক্ট হিসেবে চিন্তা করা হয়। OOP এর তিনটা প্রধান অংশ- Inheritance, Encapsulation এবং Polymorphism সম্পর্কে ক্লিয়ার ধারণা থাকতে হবে।\nস্টেপ-৬:\nআপনাকে নিজে নিজে প্রোগ্রামিং করতে হবে। দরকার হলে গুগলে সার্চ দিয়ে কোন ওয়েবসাইট থেকে দেখে দেখে টাইপ করবেন তারপরেও নিজে নিজে প্রোগ্রামিং করতে হবে। ছোট ছোট প্রোগ্রাম দিয়ে শুরু করতে হবে। যেমন, আয়তক্ষেত্রের দৈর্ঘ্য, প্রস্থ দিলে সেটার ক্ষেত্রফল বের করে দিতে পারে এমন প্রোগ্রাম। তবে প্রোগ্রামার হতে হলে আপনাকে Fibonacchi series বের করার একাধিক পদ্ধতি জানতেই হবে।\nস্টেপ-৭:\nসব প্রোগ্রামিং ল্যাঙ্গুয়েজেরই কিছু জনপ্রিয় প্যাকেজ/লাইব্রেরি/ফ্রেমওয়ার্ক থাকে। আপনাকে কমপক্ষে একটা ভালো করে জানতে হবে। তবে ধীরে ধীরে আরো কয়েকটা সম্পর্কে ধারণা নিতে হবে। প্রোগ্রামিং করার সময় বিভিন্ন সফটওয়্যার বা টেক্সট এডিটর ব্যবহার করা হয়। যেমন, Notepad++, eclipse, visual studio, webstorm, sublime text, ইত্যাদি। এদের যেকোনো একটা ব্যবহার করা জানতে হবে।\nস্টেপ-৮\nকোন একটা বিশাল সফটওয়্যার প্রোগ্রামে যদি একাধিক প্রোগ্রামার কাজ করে, তাইলে কোডগুলা কোন একটা ভার্সন কন্ট্রোল বা সোর্স কন্ট্রোল সফটওয়্যার দিয়ে সেইভ করা হয়। সোর্স কন্ট্রোল সফটওয়্যার এর মধ্যে সবচেয়ে বেশি জনপ্রিয় -github। প্রোগ্রামার হতে হলে আপনার github একাউন্ট এবং সেখানে কয়েকটা নিজস্ব প্রজেক্টের কোড থাকা উচিত।\nস্টেপ-৯:\nআপনাকে গুগল করে যেকোনো সমস্যার সমাধান বের করার দক্ষতা অর্জন করতে হবে। যারা আপনার চাইতে এগিয়ে আছে তাদের ফলো করতে হবে। ঘন্টার পর ঘন্টা টিউটোরিয়াল দেখে কাটাইতে হবে। stackoverflow তে অন্যদের প্রশ্নের উত্তর ব্যবহার করে আপনার সমস্যার সমাধান করা জানতে হবে। সবচেয়ে ভালো হয় কেউ যদি প্রোগ্রামিং কনটেস্ট বা অনলাইনে প্রবলেম সলভ করার চেষ্টা করেন।\nস্টেপ-১০:\nপ্রোগ্রামার হইতে চাইলে আত্ম-উদ্যোগী হয়ে লেগে থাকতে হবে। নিত্য নতুন কিছু ট্রাই করার ইচ্ছা থাকতে হবে। নিজে নিজে কিছু করার আকাঙ্ক্ষা থাকতে হবে।\nCollected', 0, 0, '', 8, '2019-01-28 21:54:09', '', 1),
