(25, 'সেরা প্রেজেন্টেশন দেয়ার ৬টি কৌশল', 'একটি ভাল প্রেজেন্টেশন সেটা বোর্ড রুমে হোক বা কনফারেন্সে, আপনার ক্যারিয়ারকে অনেক দূর এগিয়ে নিয়ে যেতে পারবে। যদি আপনি আপনার কনফিডেন্স এবং দক্ষতা দেখাতে পারেন তবে আপনি আপনার দর্শককে যুক্ত এবং মুগ্ধ করতে পারবেন।\nকিন্তু আপনি নিশ্চয়ই জানেন যে একটা খুব ভাল প্রেজেন্টেশন দেয়া বা কনফারেন্সে কথা বলা খুব একটা সহজ না। একটি বাজে মানের প্রেজেন্টেশন ডেকের কারনে একজন আত্মবিশ্বাসী বক্তার প্রেজেন্টেশনও খারাপ হতে পারে। আবার একইভাবে, ভাল প্রস্তুতি না থাকলে একটি উন্নতমানের ডেকও ভাল প্রেজেন্টেশন দেয়ার জন্যে যথেষ্ট না।\n\nএগুলো মাথায় রেখেই আমি এখন ৬টি কৌশল বর্ণনা করব যা যেকোন সফল প্রেজেন্টেশন দেয়ার জন্যে জরুরী :\n\n১। একটি সুস্পষ্ট লক্ষ্য থাকতে হবে\nএই প্রেজেন্টেশনটি দিয়ে আপনি কি অর্জন করতে চাচ্ছেন? আপনার দর্শক কি মুগ্ধ হয়ে এবং আপনি কি অর্জন করেছেন সেটি জেনে বের হবে? আপনার প্রতিষ্ঠান সম্পর্কে জানতে কি তারা প্রস্তুত? তারা কি আপনার ই-বুক ডাউনলোড করতে আগ্রহী?\n\nসবার সামনে আপনার লক্ষ্যটি স্পষ্টভাবে সংজ্ঞায়িত করুন। আপনার প্রেজেন্টেশনের উদ্দেশ্য আপনার স্ক্রিপ্ট থেকে শুরু করে আপনার স্লাইড ডেক পর্যন্ত সবকিছু নিয়ন্ত্রণ করবে।\n\n২। এটা আপনার শ্রোতাদের জন্য প্রয়োজনীয় কিনা দেখুন\nএক ঘন্টা ধরে দীর্ঘ সেলস পিচে বসে থাকতে কেউই পছন্দ করে না। যে কথা শুনে তাদের কোন লাভ হবে না বা যা তাদের কোন কিছু শেখাবে না এমন কোন কিছু শুনতেও কেউ পছন্দ করে না। তাই যদি আপনার মনে হয় যে আপনার পরবর্তী কনফারেন্স প্রেজেন্টেশনে আপনার কোম্পানী কীভাবে কাজ করে সে সম্পর্কে বিস্তারিত কথা বললে খুব ভাল হবে, তবে আপনি গুরুতর ভুল করছেন।\n\nপ্রতিটি প্রেজেন্টেশনে প্রকৃতপক্ষে এবং অর্থপূর্ণভাবে শ্রোতাদের গুরুত্ব দেয়া উচিত। এর মানে হচ্ছে যেসব কৌশল আপনার জন্যে কাজ করেছে সেগুলো শেয়ার করা;  কোন বিষয়ে জ্ঞানগর্ভ তথ্য প্রদান করা; অথবা গল্পের ছলে কথা বলা যা থেকে তারা থেকে কিছু শিখতে পারবে। শুধুমাত্র আপনার শ্রোতাদের প্রয়োজন বিবেচনা করলেই আপনি তাদের আস্থা এবং বিশ্বাস লাভ করতে পারবেন।\n\n৩। প্রেজেন্টেশনটি ভালভাবে রিহার্সড হতে হবে\nহ্যাঁ, প্রেজেন্টেশনটি আপনাকে অবশ্যই অনেকবার প্র্যাকটিস করতে হবে। আপনি যা বলেতে চাচ্ছেন তা শুধু স্পষ্টভাবে বললেই হবে না, খুবই গুছিয়ে বলতে হবে এবং আপনি পর্দায় যা দেখাবেন সেটিও সতর্কতার সাথে বাছাই করতে হবে। বারবার প্র্যাকটিস আপনাকে একজন স্পিকার হিসাবে কনফিডেন্স তৈরি করতে সহায়তা করবে এবং এটিও আপনার দর্শকদের আরও আকৃষ্ট করবে।যদি আপনি এই প্রেজেন্টেশনটি পূর্বে আরও অনেক বার করে থাকেন তবুও রিহার্সাল অপরিহার্য।  এ সব কিছুর পরেও, প্রতিটি শ্রোতাই আলাদা, তাই আপনার শ্রোতাদের চাহিদা এবং প্রয়োজন অনুযায়ী প্রতিবার আপনার প্রেজেন্টেশনটিকে সামঞ্জস্য করতে হবে।\n\n\n৪।  আপনার প্রেজেন্টেশন ডেকে কম টেক্সট ব্যবহার করুন\nস্লাইড ডেকে অনেক বেশি টেক্সট ছিল এরকম অনেক প্রেজেন্টেশনেই আমরা অংশগ্রহন করেছি। স্পিকারের কথা মনোযোগ সহকারে শোনার সময় কয়েকটি শব্দের চেয়ে বেশি পড়া অসম্ভব।আপনার প্রেজেন্টেশনে অংশগ্রহণকারীদের রিডিং এসাইনমেন্ট না দেয়াই ভাল। এটি আপনার প্রেজেন্টেশনের সামগ্রিক অভিজ্ঞতাকে কম উপভোগ্য করে তুলবে। আপনার শ্রোতারা তখন স্বাভাবিকভাবেই অমনোযোগী এমনকি বিভ্রান্তও হয়ে যেতে পারে। এর পরিবর্তে, আপনি যে বিষয়গুলি নিয়ে আলোচনা করছেন সেগুলোকে অর্থপূর্ণভাবে তুলে ধরতে ফোকাস করুন –  উদাহরণস্বরূপ আপনি গ্রাফের সাহায্য নিতে পারেন।\n\n৫। আপনার কন্টাক্ট তথ্য স্পষ্টভাবে উল্লেখ করুন\nআমার কনফারেন্স প্রেজেন্টেশনে, আমি আমার প্রত্যেক স্লাইডে আমার কোম্পানির লোগো এবং আমাদের টুইটার হ্যান্ডেল অন্তর্ভুক্ত করি। আমি নিশ্চিত করি যে দর্শকদের কাছে আমরা কে এবং আমাদের কাছে পৌঁছাতে এবং আমাদের সাথে যোগাযোগ করতে কি করতে সে বিষয়ে যেন যথেষ্ট পরিমাণ তথ্য থাকে। এটি কনফারেন্স প্রেজেন্টেশনের জন্য বিশেষভাবে দরকারী এবং এটা হয়ত আপনার কাজের জায়গার প্রেজেন্টেশন জন্য প্রয়োজনীয় নাও হতে পারে। তবুও, এটি নিশ্চিত করতে ভুলবেন না যে প্রত্যেকের কাছে আপনার সাথে যোগাযোগ করার যথেষ্ট উপায় রয়েছে এবং আপনার শেষ স্লাইডে স্পষ্টভাবে আপনার নাম এবং আপনার সাথে যোগাযোগের তথ্য দিতে ভুলবেন না।\n\n ৬। আপনার প্রেজেন্টেশনে একটি কল-টু-অ্যাকশন অন্তর্ভুক্ত করুন\nপ্রতিটি প্রেজেন্টেশনের যেমন একটি স্পষ্টভাবে সংজ্ঞায়িত লক্ষ্য রয়েছে, তেমনই এটির একটি পরিষ্কার কল-টু-অ্যাকশনও থাকতে হবে। আপনার প্রেজেন্টেশনের শেষে আপনি আপনার দর্শকদের কী করাতে চান? প্রেজেন্টেশন পরবর্তী ধাপ অনুসরণ করার জন্য আপনার তাদেরকে একটি সহজ উপায় দিতে হবে।', 0, 0, '', 8, '2019-04-01 19:06:55', '', 1),
